import React from 'react';
import QuestionContainer from './Components/QuestionContainer'
import { Button } from 'semantic-ui-react'
import 'semantic-ui-css/semantic.min.css'
import './App.css'

const App = () => {
  return (
    <>
      <h1>Lutrivia</h1>
      <Button content="New Game" />
      <QuestionContainer />
    </>
  );
}

export default App;
